document.getElementById("feedbackForm").addEventListener("submit",function(e){e.preventDefault();let t={likes:document.getElementById("like").value,dislikes:document.getElementById("dislike").value,features:document.getElementById("features").value,comments:document.getElementById("comments").value};fetch("/log-survey",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify(t)}).then(e=>e.json()).then(e=>console.log("Feedback submitted successfully")).catch(e=>console.error("Error:",e))});